import React, { Component } from 'react';
import "../styles/style.css"

class TopBar extends Component {
    render() {
        return (
            <div className="TopBar">
                <h1>Jason Brooks</h1>
                <h3>Full-Stack Software Developer</h3>

            </div>
        );
    }
}

export default TopBar;
